window.bookSummaryJSON = "<p>\"About the dangers out there.\" Nubern leaned in to the camera. \"There is much more going on in Quadrant Eight than I have been at liberty to tell you.\" </p> <p>Austin Stone always heard you can't go home again, but he is looking forward to his leave on Earth. Upon his arrival Austin is immediately thrust into danger as a shadowy force targets Star Runners and their loved ones on Earth in a series of violent attacks. After surviving an explosion on the streets of San Francisco, Austin rushes back to Georgia to secure the safety of his mother. </p> <p>Violence builds, and an unimaginable attack is launched, leading Austin back into the seat of a Trident fighter to defend his home and family. </p>"; 
